import NavbarHome from "../../components/NavbarHome";

export default function Home() {
  return (
    <div>
      <NavbarHome />
      <div style={{ backgroundImage: 'url("images/homebackground.png")', backgroundSize: 'cover', minHeight: '100vh' }}></div>
      <NavbarHome />
    </div>
  );
}
